<!DOCTYPE html>
<html>

<head>
    <meta charset="UTF-8" />

    <title>Open-IW5</title>

    <style>
        * {
            user-select: none;
            -ms-user-select: none;
            cursor: default;
        }

        html,
        body {
            margin: 0;
            background-color: #2D2D2D;
            color: white;

            font-family: "Segoe UI Light", "Segoe UI", "Lucida Sans", Arial, sans-serif;
            font-style: normal;
            font-weight: lighter;

            width: 100%;
            height: 100%;

            overflow: hidden;
        }

        .button {
            display: inline-block;
            text-align: center;
            width: 20%;
            display: table-cell;
            vertical-align: middle;
        }

        .button>span {
            display: block;
            margin-bottom: 10px;
            font-size: 20px;
        }

        .button>img {
            width: 120px;
            height: 120px;
            border-radius: 10px;
            transition: all 0.1s ease-out;
            cursor: pointer;
            box-shadow: 0px 2px 40px 10px rgba(0, 0, 0, 0.3);
        }

        .button>img:hover {
            box-shadow: 0px 2px 40px 10px rgba(0, 0, 0, 0);
        }

        .button:first-of-type {
            border-right: 5px solid #1F1F1F;
        }

        .button:last-of-type {
            border-left: 5px solid #1F1F1F;
        }

        .content {
            width: 100%;
            height: 100%;
            margin: auto;
            display: table;
        }
    </style>
</head>
